import Style from './MenuInterno.module.css'
import { Link } from 'react-router-dom'
function MenuInterno(props) {
    return (
        <div className={Style.Geral}>

                <div>{props.img}</div>
                <div>{props.texto}</div>

        </div>
    )
}
export default MenuInterno
